    //                 <div key={meal.idMeal}>
    //                     <p>{meal.strMeal}</p>
    //                 </div>
    //             ))
    //         }
    //     </>
    // );

    return (
        <>
            {meals.map(meal => (
                <div key={meal.idMeal}>
                    <p>{meal.strMeal}</p>
                    {/* You can display more details of the meal here */}
                </div>
            ))}
        </>
    );
}
